import React, { Component } from "react";
import Post from "./Post";

class Posts extends Component {
  render() {
    let posts = [
      { id: 123, title: "banana one", author: "wuff" },
      { id: 321, title: "fruit one", author: "meaw" },
      { id: 534, title: "health one", author: "ding" },
      { id: 674, title: "injection one", author: "ding" },
    ];
    return (
      <div className="posts">
        {posts.map((eachPost) => {
          console.log("from Post ", eachPost);
          <Post
            id={eachPost.id}
            author={eachPost.author}
            title={eachPost.title}
          />;
        })}
      </div>
    );
  }
}

export default Posts;
